import{__plugin_vue_export_helper_default as e,createElementBlock as t,createStaticVNode as n,openBlock as r}from"./chunks/plugin-vue_export-helper.Bts1mPc7.js";const i=JSON.parse(`{"title":"Política de Privacidade","description":"","frontmatter":{"head":[["link",{"rel":"canonical","href":"https://idoc.dev/pt/privacy"}],["meta",{"property":"og:url","content":"https://idoc.dev/pt/privacy"}]]},"headers":[],"relativePath":"pt/privacy.md","filePath":"pt/privacy.md","lastUpdated":1735112084000}`),a={name:`pt/privacy.md`};function o(e,i,a,o,s,c){return r(),t(`div`,null,i[0]||=[n(`<h1 id="politica-de-privacidade" tabindex="-1">Política de Privacidade <a class="header-anchor" href="#politica-de-privacidade" aria-label="Permalink to “Política de Privacidade”">​</a></h1><p>Bem-vindo ao iDoc.dev. Esta política de privacidade descreve como coletamos, usamos e protegemos suas informações pessoais quando você visita nosso site <a href="https://idoc.dev" target="_blank" rel="noreferrer">https://idoc.dev</a> (o &quot;Site&quot;).</p><p>Ao acessar ou usar o Site, você concorda com esta política de privacidade. Se você não concorda com os termos, por favor, não use nossos serviços.</p><h2 id="_1-informacoes-que-coletamos" tabindex="-1">1. Informações que Coletamos <a class="header-anchor" href="#_1-informacoes-que-coletamos" aria-label="Permalink to “1. Informações que Coletamos”">​</a></h2><p>Coletamos os seguintes tipos de informações dos usuários:</p><h3 id="a-informacoes-pessoais" tabindex="-1">a. Informações Pessoais <a class="header-anchor" href="#a-informacoes-pessoais" aria-label="Permalink to “a. Informações Pessoais”">​</a></h3><p>Quando você se inscreve em nossos serviços ou entra em contato conosco, podemos coletar informações pessoais como:</p><ul><li>Nome</li><li>Endereço de e-mail</li><li>Informações de contato</li></ul><h3 id="b-dados-de-uso" tabindex="-1">b. Dados de Uso <a class="header-anchor" href="#b-dados-de-uso" aria-label="Permalink to “b. Dados de Uso”">​</a></h3><p>Podemos coletar informações não identificáveis pessoalmente sobre como você interage com o Site, incluindo:</p><ul><li>Endereço IP</li><li>Tipo e versão do navegador</li><li>Páginas visitadas</li><li>Tempo gasto nas páginas</li><li>Site de referência</li></ul><h2 id="_2-como-usamos-suas-informacoes" tabindex="-1">2. Como Usamos Suas Informações <a class="header-anchor" href="#_2-como-usamos-suas-informacoes" aria-label="Permalink to “2. Como Usamos Suas Informações”">​</a></h2><p>Usamos suas informações pessoais para os seguintes fins:</p><ul><li>Fornecer e manter nossos serviços</li><li>Responder às suas solicitações e dúvidas de suporte</li><li>Personalizar sua experiência no Site</li><li>Melhorar o desempenho e os recursos do Site</li><li>Enviar promoções ou atualizações ocasionais (você pode se desinscrever a qualquer momento)</li></ul><h2 id="_3-cookies-e-tecnologias-de-rastreamento" tabindex="-1">3. Cookies e Tecnologias de Rastreamento <a class="header-anchor" href="#_3-cookies-e-tecnologias-de-rastreamento" aria-label="Permalink to “3. Cookies e Tecnologias de Rastreamento”">​</a></h2><p>Usamos cookies e tecnologias de rastreamento semelhantes para monitorar a atividade em nosso Site e melhorar sua experiência. Isso pode incluir:</p><ul><li>Cookies de sessão (para o funcionamento de nosso serviço)</li><li>Cookies de preferências (para lembrar suas preferências)</li><li>Cookies de análise (para entender como os visitantes interagem com o Site)</li></ul><p>Você pode controlar suas configurações de cookies através de seu navegador, mas desativar os cookies pode afetar sua experiência.</p><h2 id="_4-servicos-de-terceiros" tabindex="-1">4. Serviços de Terceiros <a class="header-anchor" href="#_4-servicos-de-terceiros" aria-label="Permalink to “4. Serviços de Terceiros”">​</a></h2><p>Podemos usar prestadores de serviços terceirizados para nos ajudar a operar e melhorar o Site, como:</p><ul><li>Fornecedores de análise (por exemplo, Google Analytics)</li><li>Processadores de pagamento</li></ul><p>Esses serviços de terceiros podem coletar dados pessoais de acordo com suas próprias políticas de privacidade. Não somos responsáveis pelas práticas de privacidade deles.</p><h2 id="_5-seguranca-dos-dados" tabindex="-1">5. Segurança dos Dados <a class="header-anchor" href="#_5-seguranca-dos-dados" aria-label="Permalink to “5. Segurança dos Dados”">​</a></h2><p>Tomamos medidas razoáveis para proteger suas informações pessoais contra acesso ou divulgação não autorizada. No entanto, nenhum método de transmissão pela Internet é 100% seguro, e não podemos garantir segurança absoluta.</p><h2 id="_6-retencao-de-dados" tabindex="-1">6. Retenção de Dados <a class="header-anchor" href="#_6-retencao-de-dados" aria-label="Permalink to “6. Retenção de Dados”">​</a></h2><p>Retemos as informações pessoais apenas pelo tempo necessário para as finalidades descritas nesta política de privacidade. Também podemos reter certas informações para cumprir obrigações legais, resolver disputas e fazer cumprir acordos.</p><h2 id="_7-seus-direitos" tabindex="-1">7. Seus Direitos <a class="header-anchor" href="#_7-seus-direitos" aria-label="Permalink to “7. Seus Direitos”">​</a></h2><p>Você tem os seguintes direitos em relação aos seus dados pessoais:</p><ul><li>Acesso: Você pode solicitar uma cópia dos dados pessoais que mantemos sobre você.</li><li>Correção: Você pode solicitar a correção de quaisquer informações imprecisas.</li><li>Exclusão: Você pode solicitar a exclusão de suas informações pessoais, sujeitas a requisitos legais.</li><li>Cancelamento: Você pode cancelar a inscrição nos e-mails de marketing seguindo as instruções de cancelamento de inscrição nesses e-mails.</li></ul><h2 id="_8-alteracoes-a-esta-politica-de-privacidade" tabindex="-1">8. Alterações a Esta Política de Privacidade <a class="header-anchor" href="#_8-alteracoes-a-esta-politica-de-privacidade" aria-label="Permalink to “8. Alterações a Esta Política de Privacidade”">​</a></h2><p>Podemos atualizar esta política de privacidade de tempos em tempos. Quaisquer alterações serão publicadas nesta página com uma data de &quot;Última atualização&quot; atualizada. Consulte periodicamente esta política para verificar atualizações.</p><h2 id="_9-contate-nos" tabindex="-1">9. Contate-Nos <a class="header-anchor" href="#_9-contate-nos" aria-label="Permalink to “9. Contate-Nos”">​</a></h2><p>Se você tiver dúvidas ou preocupações sobre esta política de privacidade, entre em contato conosco através de:</p><ul><li>E-mail: <a href="mailto:support@idoc.dev" target="_blank" rel="noreferrer">support@idoc.dev</a></li></ul><p>Obrigado por visitar <a href="https://idoc.dev/pt/" target="_blank" rel="noreferrer">iDoc.dev</a>!</p>`,35)])}var s=e(a,[[`render`,o]]);export{i as __pageData,s as default};